  cwtchStruct.prototype.uciExec = function (e) {
  
    const messageList = e.split('\n');
  
    for (let messageNum=0; messageNum < messageList.length; messageNum++ ) {
  
      let message = messageList[messageNum].replace(/(\r\n|\n|\r)/gm,"");
  
      message = message.trim();
      message = message.replace(/\s+/g,' ');
  
      const tokens  = message.split(' ');
      const command = tokens[0];
  
      if (!command)
        continue;
  
      switch (command) {
  
        case 'position':
        case 'p': {
          //{{{  position
          
          switch (tokens[1]) {
          
            case 'startpos':
            case 's':
          
              this.position('rnbqkbnr/pppppppp/8/8/8/8/PPPPPPPP/RNBQKBNR', 'w', 'KQkq', '-');
              if (tokens[2] == 'moves') {
                for (let i=3; i < tokens.length; i++)
                  this.playMove(tokens[i]);
              }
              break;
          
            case 'fen':
            case 'f':
          
              this.position(tokens[2], tokens[3], tokens[4], tokens[5]);
              if (tokens[8] == 'moves') {
                for (let i=9; i < tokens.length; i++)
                  this.playMove(tokens[i]);
              }
              break;
          
            default:
          
              console.log(command, tokens[1], 'not implemented');
              break;
          }
          
          break;
          
          //}}}
        }
  
        case 'go':
        case 'g': {
          //{{{  go
          
          const slop = 1;
          
          let wTime     = 0;
          let bTime     = 0;
          let wInc      = 0;
          let bInc      = 0;
          let moveTime  = 0;
          let movesToGo = 0;
          let depth     = 0;
          let nodes     = 0;
          let softNodes = 0;
          
          let i = 1;
          
          while (i < tokens.length) {
            switch (tokens[i]) {
              case 'depth':
              case 'd': {
                depth = parseInt(tokens[i+1]);
                i += 2;
                break;
              }
              case 'nodes': {
                nodes = parseInt(tokens[i+1]);
                i += 2;
                break;
              }
              case 'softnodes': {
                softNodes = parseInt(tokens[i+1]);
                i += 2;
                break;
              }
              case 'movestogo': {
                movesToGo = parseInt(tokens[i+1]);
                i += 2;
                break;
              }
              case 'movetime':
              case 'mt': {
                moveTime = parseInt(tokens[i+1]);
                i += 2;
                break;
              }
              case 'winc': {
                wInc = parseInt(tokens[i+1]);
                i += 2;
                break;
              }
              case 'binc': {
                bInc = parseInt(tokens[i+1]);
                i += 2;
                break;
              }
              case 'wtime': {
                wTime = parseInt(tokens[i+1]);
                i += 2;
                break;
              }
              case 'btime': {
                bTime = parseInt(tokens[i+1]);
                i += 2;
                break;
              }
              default: {
                console.log('unknown go token', tokens[i]);
                i++;
              }
            }
          }
          
          if (depth)
            this.targetDepth = depth;
          else
            this.targetDepth = MAX_PLY - 1;
          
          if (nodes)
            this.targetNodes = nodes;
          else
            this.targetNodes = 0;
          
          if (softNodes)
            this.softNodes = softNodes;
          else
            this.softNodes = 0;
          
          if (moveTime > 0)
            this.finishTime = Date.now() + moveTime + slop;
          
          else {
          
            if (movesToGo)
              movesToGo += 2;
            else
              movesToGo = 30;
          
            if (wTime && this.turn == WHITE)
              this.finishTime = Date.now() + 0.95 * (wTime/movesToGo + wInc) + slop;
            else if (bTime && this.turn == BLACK)
              this.finishTime = Date.now() + 0.95 * (bTime/movesToGo + bInc) + slop;
            else
              this.finishTime = 0;
          }
          
          this.go();
          
          break;
          
          //}}}
        }
  
        case 'uci': {
          //{{{  uci
          
          uciLog('id name cwtch g2');
          uciLog('id author Colin Jenkins');
          uciLog('uciok');
          
          break;
          
          //}}}
        }
  
        case 'isready': {
          //{{{  isready
          
          uciLog('readyok');
          
          break;
          
          //}}}
        }
  
        case 'stop': {
          //{{{  stop
          
          break;
          
          //}}}
        }
  
        case 'ucinewgame':
        case 'u': {
          //{{{  ucinewgame
          
          this.newGame();
          
          break;
          
          //}}}
        }
  
        case 'board':
        case 'b': {
          //{{{  board
          
          this.printBoard();
          
          break;
          
          //}}}
        }
  
        case 'draw':
        case 'd': {
          //{{{  draw
          
          console.log(this.isDraw());
          
          break;
          
          //}}}
        }
  
        case 'fen':
        case 'f': {
          //{{{  fen
          
          console.log(this.fen(0));
          
          break;
          
          //}}}
        }
  
        case 'hash':
        case 'h': {
          //{{{  hash
          
          console.log(this.hHi[0],this.hLo[0]);
          console.log(this.hHistoryLimit,this.hHistoryNext);
          
          break;
          
          //}}}
        }
  
        case 'eval':
        case 'e': {
          //{{{  eval
          
          const e1 = this.netSlowEval();
          const e2 = this.netFastEval();
          
          console.log('slow',e1,'fast',e2);
          
          break;
          
          //}}}
        }
  
        case 'net':
        case 'n': {
          //{{{  net info
          
          console.log('h1 size', net_h1_size);
          console.log('lr', net_lr);
          console.log('batch size', net_batch_size);
          console.log('activation', net_activation);
          console.log('stretch', net_stretch);
          console.log('interp', net_interp);
          console.log('num_batches', net_num_batches);
          console.log('opt', net_opt);
          console.log('l2reg', net_l2_reg);
          console.log('epochs', net_epochs);
          console.log('loss', net_loss);
          
          let maxWeight = -9999;
          let minWeight = 9999;
          
          for (let i=0; i < net_h1_w.length; i++) {
            for (let j=0; j < net_h1_size; j++) {
              const w = Math.abs(net_h1_w[i][j]);
              if (w < minWeight)
                minWeight = w;
              if (w > maxWeight)
                maxWeight = w;
            }
          }
          
          console.log('min h1 weight', minWeight);
          console.log('max h1 weight', maxWeight);
          
          maxWeight = -9999;
          minWeight = 9999;
          
          for (let j=0; j < net_h1_size; j++) {
            const w = Math.abs(net_o_w[j]);
            if (w < minWeight)
              minWeight = w;
            if (w > maxWeight)
              maxWeight = w;
          }
          
          console.log('min o weight', minWeight);
          console.log('max o weight', maxWeight);
          
          break;
          
          //}}}
        }
  
        case 'quit':
        case 'q': {
          //{{{  quit
          
          process.exit();
          
          break;
          
          //}}}
        }
  
        case 'datagen': {
          //{{{  datagen
          
          const file      = tokens[2];
          const games     = parseInt(tokens[4]);
          const softNodes = parseInt(tokens[6]);
          const hardNodes = parseInt(tokens[8]);
          const rand      = parseInt(tokens[10]);
          const first     = parseInt(tokens[12]);
          
          this.datagen(file, games, softNodes, hardNodes, rand, first);
          
          break;
          
          //}}}
        }
  
        case 'perft': {
          //{{{  perft
          
          const depth  = parseInt(tokens[1]);
          const t      = Date.now();
          const pmoves = perft(depth);
          
          console.log(pmoves,'moves ',Date.now()-t,'ms');
          
          break;
          
          //}}}
        }
  
        case 'bench': {
          //{{{  bench
          
          this.quiet = 1;
          
          let nodes = 0;
          
          const t1 = Date.now();
          
          for (let i=0; i < bFens.length; i++) {
          
            process.stdout.write(i+'\r');
          
            const fen = bFens[i];
          
            this.uciExec('ucinewgame');
            this.uciExec('position fen ' + fen);
            this.uciExec('go depth 10');
          
            nodes += this.nodeCount;
          }
          
          const t2  = Date.now();
          const sec = (Math.round((t2-t1)/100)/10);
          
          console.log(sec,nodes);
          
          this.quiet = 0;
          
          break;
          
          //}}}
        }
  
        case 'et': {
          //{{{  eval tests
          
          for (let i=0; i < bFens.length; i++) {
          
            const fen = bFens[i];
          
            this.uciExec('ucinewgame');
            this.uciExec('position fen ' + fen);
            //this.uciExec('go depth 3')
            this.uciExec('e');
          
          }
          
          break;
          
          //}}}
        }
  
        case 'pt': {
          //{{{  perft tests
          
          let num = 0;
          
          if (tokens.length > 1)
            num = parseInt(tokens[1]);
          else
            num = pFens.length;
          
          let errs = 0;
          
          const t1 = Date.now();
          
          for (let i=0; i < num; i++) {
          
            const p = pFens[i];
          
            const fen   = p[0];
            const depth = p[1];
            const moves = p[2];
            const id    = p[3];
          
            this.uciExec('ucinewgame');
            this.uciExec('position ' + fen);
          
            const pmoves = this.perft(this.nodes[0], depth);
            const err    = pmoves - moves;
          
            errs += err;
          
            const t2  = Date.now();
            const sec = (''+Math.round((t2-t1)/100)/10).padEnd(6);
          
            console.log(sec,id,fen,depth,moves,pmoves,err,errs);
          }
          
          const t2  = Date.now();
          const sec = Math.round((t2-t1)/100)/10;
          
          console.log(sec, 'sec', errs, 'perft errors');
          
          break;
          
          //}}}
        }
  
        default:
          //{{{  ?
          
          console.log(command, '?');
          
          break;
          
          //}}}
      }
    }
  }
  
  //}}}
  
  //{{{  go
  //
  // the shape of this funcion is taken from ethereal
  // https://github.com/AndyGrant/Ethereal/blob/master/src/search.c#L274
  //
  
  cwtchStruct.prototype.go = function () {
  
    this.bestMove   = 0;
    this.bestScore  = 0;
    this.outOfTime  = 0;
    this.nodeCount  = 0;
  
    let score = 0;
    let alpha = 0;
    let beta  = 0;
    let delta = 0;
  
    for (let depth=1; depth <= this.targetDepth; depth++) {
  
      alpha = -MATE;
      beta  = MATE;
      delta = 10;
  
      if (depth >= 4) {
        alpha = Math.max(-MATE, score - delta);
        beta  = Math.min(MATE,  score + delta);
      }
  
      while (1) {
  
        score = this.search(this.nodes[0], alpha, beta, depth);
  
        if (this.outOfTime)
          break;
  
        if (score > alpha && score < beta) {
          uciLog('info', 'depth', depth, 'nodes', this.nodeCount, 'score', score, 'pv', formatMove(this.bestMove));
          break;
        }
  
        delta += delta / 2 | 0;
  
        if (score <= alpha) {
          uciLog('info', 'depth', depth, 'nodes', this.nodeCount, 'upperbound', score);
          beta  = Math.min(MATE, ((alpha + beta) / 2) | 0);
          alpha = Math.max(-MATE, score - delta);
        }
        else if (score >= beta) {
          uciLog('info', 'depth', depth, 'nodes', this.nodeCount, 'lowerbound', score);
          alpha = Math.max(-MATE, ((alpha + beta) / 2) | 0);
          beta  = Math.min(MATE,  score + delta);
        }
      }
  
      if (this.bestMove && this.softNodes && this.nodeCount >= this.softNodes)
        break;
  
      if (this.outOfTime)
        break;
    }
  
    uciLog('bestmove', formatMove(this.bestMove));
  }
  
  //}}}
  //{{{  search
  
  cwtchStruct.prototype.search = function (node, alpha, beta, depth) {
  
    //{{{  housekeeping
    
    node.child.no = 0;
    
    if (this.areWeOutOfTime() || !node.child) {
    
      this.outOfTime = 1;
    
      return 0;
    }
    
    //}}}
    //{{{  mate distance pruning
    /*
    if (!rootNode) {
    
      let matingValue = MATE - node.ply;
    
      if (matingValue < beta) {
         beta = matingValue;
         if (alpha >= matingValue)
           return matingValue;
      }
    
      matingValue = -MATE + node.ply;
    
      if (matingValue > alpha) {
         alpha = matingValue;
         if (beta <= matingValue)
           return matingValue;
      }
    }
    hack */
    //}}}
  
    const turn     = this.turn;
    const nextTurn = colourToggle(turn);
    const cx       = colourIndex(turn);
    const list     = this.cxList[cx];
    const inCheck  = this.isKingAttacked(list[LKING], nextTurn);
  
    if (depth <= 0 && !inCheck)
      return this.qsearch(node.child, alpha, beta, depth);
  
    this.nodeCount++;
  
    depth = Math.max(0, depth);
  
    const rootNode = !node.parent;
    const pvNode   = alpha != (beta - 1);
    const oAlpha   = alpha;
  
    if (!rootNode && this.isDraw())
      return 0;
  
    //{{{  check tt
    
    const ttIndex = this.ttIndex();
    
    node.ttMove = 0;
    
    if (ttIndex) {
    
      const ttFlags = this.ttFlags[ttIndex];
      const ttScore = this.ttScore[ttIndex];
    
      if (this.ttDepth[ttIndex] >= depth && (depth == 0 || !pvNode)) {
        if (ttFlags == TT_EXACT ||
           (ttFlags == TT_BETA  && ttScore >= beta) ||
           (ttFlags == TT_ALPHA && ttScore <= alpha)) {
          return ttScore;
        }
      }
    
      node.ttMove = this.ttMove[ttIndex];
    }
    
    //{{{  no tt move
    //
    // https://www.talkchess.com/forum3/viewtopic.php?f=7&t=74769
    //
    
    if (!node.ttMove && depth > 3)
      depth -= 1;
    
    //}}}
    
    //}}}
    //{{{  improving?
    
    let improv = 0;
    let ev     = 0
    
    if (ttIndex)
      ev = this.ttEval[ttIndex];
    else
      ev = this.netFastEval();
    
    node.ev = ev;
    
    if (node.granny && (ev - node.granny.ev) > 0)
      improv = 1; //optimize
    
    //}}}
    //{{{  alpha pruning
    
    if (!inCheck && !rootNode && !pvNode && depth <= 5 && (ev + 1000) < alpha) {
      return ev;
    }
    
    //}}}
    //{{{  beta pruning
    
    if (!inCheck && !rootNode && !pvNode && depth <= 5 && (ev - depth * 75) >= beta) {
      return ev;
    }
    
    //}}}
  
    node.cacheSave();
  
    let score = 0;
  
    //{{{  null move pruning
    
    if (!node.no && !inCheck && !rootNode && !pvNode && depth > 2 && ev > beta) {
    
      this.hashEP();
      this.ep = 0;
      this.hashEP();
    
      this.hashTurn();
      this.turn = colourToggle(this.turn);
      this.hashTurn();
    
      node.child.no = 1;
    
      score = -this.search(node.child, -beta, -beta+1, depth-4);
    
      node.cacheUnsave();
      this.turn = colourToggle(this.turn);
    
      if (this.outOfTime)
        return 0;
    
      if (score >= beta) {
        return beta;
      }
    }
    
    //}}}
  
    let bestScore = -MATE;
    let bestMove  = 0;
  
    let move   = 0;
    let played = 0;
    let quiets = 0;
  
    node.initMoveGen(ALL_MOVES, inCheck);
  
    while (move = node.getNextMove()) {
  
      if (node.stage == 5)
        quiets++;
  
      const keeper = move & MOVE_KEEPER_MASK;
  
      //{{{  late move pruning
      
      let cutoff = 4 + depth * depth;
      if (!improv)
        cutoff = cutoff / 2 | 0;
      
      if (!keeper && played && quiets > cutoff && !inCheck && !rootNode && !pvNode && depth <= 8) {
        continue;
      }
      
      //}}}
      //{{{  futility pruning
      
      if (!keeper && played && quiets && !inCheck && !rootNode && !pvNode && depth <= 2 && (ev + depth * depth * 100) < alpha) {
        continue;
      }
      
      //}}}
      //{{{  see pruning
      
      //cutoff = 4 + depth;
      
      //if (played && quiets > cutoff && !inCheck && !rootNode && !pvNode && depth <= 8 && this.quickSee(move) < 0) {
        //continue;
      //}
      
      //}}}
  
      //{{{  make move
      
      if (!(move & MOVE_LEGAL_MASK)) {
      
        this.makeMoveBare(move);
      
        if (this.isKingAttacked(list[LKING], nextTurn)) {
          this.unmakeMoveBare(move);
          //node.cacheUnsave();
          continue;
        }
      
        this.unmakeMoveBare(move);
        this.makeMove(move);
      }
      
      else {
        this.makeMove(move);
      }
      
      //}}}
  
      played++;
  
      //{{{  reduce/extend?
      
      let R = 0;
      
      if (played > 4 && depth >= 3) {
      
        R = 1 + depth/5 + played/20 | 0;
      
        if (pvNode)
          R -= 1;
      
        if (inCheck) // hack && depth > 5
          R -= 1;
      
        if (node.stage < 5)
          R -= 1;
      
        if (moveIsNoisy(node.ttMove))
          R += 1;
      
        if (moveIsNoisy(move))
          R += 1;
      
        if (!improv)
          R += 1;
      
        //if (depth-1-R < 1)
          //R = depth-2;
      
        //if (inCheck)
          //R = -1;
      }
      
      //}}}
  
      if (pvNode) {
        if (played == 1) {
          score = -this.search(node.child, -beta, -alpha, depth-1);
        }
        else {
          score = -this.search(node.child, -alpha-1, -alpha, depth-1-R);
          if (!this.outOfTime && score > alpha) {
            score = -this.search(node.child, -beta, -alpha, depth-1);
          }
        }
      }
      else {
        score = -this.search(node.child, -beta, -alpha, depth-1-R);
        if (R && !this.outOfTime && score > alpha)
          score = -this.search(node.child, -beta, -alpha, depth-1);
      }
  
      this.unmakeMove(move);
      node.cacheUnsave();
  
      if (this.outOfTime)
        return 0;
  
      if (score > bestScore) {
        bestScore = score;
        bestMove  = move;
        if (bestScore > alpha) {
          alpha = bestScore;
          if (rootNode) {
            this.bestMove  = bestMove;
            this.bestScore = bestScore;
          }
          if (bestScore >= beta) {
            if (moveIsQuiet(move))
              node.killer = moveClean(move);
            this.ttPut(TT_BETA, depth, bestScore, bestMove, ev);
            this.historyAdd(bestMove, depth*depth)
            return bestScore;
          }
        }
      }
    }
  
    if (!played)
      return inCheck ? -MATE + node.ply : 0;
  
    if (alpha > oAlpha)
      this.ttPut(TT_EXACT, depth, bestScore, bestMove, ev);
    else
      this.ttPut(TT_ALPHA, depth, bestScore, bestMove, ev);
  
    return bestScore;
  }
  
  //}}}
  //{{{  qsearch
  
  cwtchStruct.prototype.qsearch = function (node, alpha, beta, depth) {
  
    //{{{  housekeeping
    
    this.nodeCount++;
    
    if (this.areWeOutOfTime() || !node.child) {
    
      this.outOfTime = 1;
    
      return this.netFastEval();
    }
    
    //}}}
  
    //{{{  check TT
    
    node.ttMove = 0;
    
    const ttIndex = this.ttIndex();
    
    if (ttIndex) {
    
      const ttFlags = this.ttFlags[ttIndex];
      const ttScore = this.ttScore[ttIndex];
      const ttMove  = this.ttMove[ttIndex];
    
      if (ttFlags == TT_EXACT ||
         (ttFlags == TT_BETA  && ttScore >= beta) ||
         (ttFlags == TT_ALPHA && ttScore <= alpha)) {
        return ttScore;
      }
    
      if (moveIsNoisy(ttMove))
        node.ttMove = ttMove;
    
    }
    
    //}}}
  
    let e = 0;
  
    if (ttIndex)
      e = this.ttEval[ttIndex];
    else
      e = this.netFastEval();
  
    if (e >= beta)
      return e;
  
    if (alpha < e)
      alpha = e;
  
    const turn     = this.turn;
    const nextTurn = colourToggle(turn);
    const cx       = colourIndex(turn);
    const list     = this.cxList[cx];
    const inCheck  = this.isKingAttacked(list[LKING], nextTurn);
  
    let move   = 0;
    let score  = 0;
    let played = 0;
  
    node.cacheSave();
  
    node.initMoveGen(NOISY_MOVES_ONLY, inCheck);
  
    while (move = node.getNextMove()) {
  
      if (moveIsQuiet(move))
        console.log('quiet q move', formatMove(move)); //hack
  
      if (!inCheck && this.quickSee(move) < 0)
        continue;
  
      //{{{  make move
      
      if (!(move & MOVE_LEGAL_MASK)) {
      
        this.makeMoveBare(move);
      
        if (this.isKingAttacked(list[LKING], nextTurn)) {
          this.unmakeMoveBare(move);
          //node.cacheUnsave();
          continue;
        }
      
        this.unmakeMoveBare(move);
        this.makeMove(move);
      }
      
      else {
        this.makeMove(move);
      }
      
      //}}}
  
      played++;
  
      score = -this.qsearch(node.child, -beta, -alpha, depth-1);
  
      this.unmakeMove(move);
      node.cacheUnsave();
  
      if (this.outOfTime)
        return alpha;
  
      if (score > alpha) {
        alpha = score;
        if (score >= beta) {
          return score;
        }
      }
    }
  
    return alpha;
  }
  
  //}}}
  //{{{  perft
  
  cwtchStruct.prototype.perft = function (node, depth) {
  
    if (depth == 0)
      return 1;
  
    const turn     = this.turn;
    const nextTurn = colourToggle(turn);
    const cx       = colourIndex(turn);
    const list     = this.cxList[cx];
    const inCheck  = this.isKingAttacked(list[LKING], nextTurn);
  
    let count = 0;
    let move  = 0;
  
    node.ttMove = 0;
  
    node.cacheSave();
    node.initMoveGen(ALL_MOVES, inCheck);
  
    while (move = node.getNextMove()) {
  
      //{{{  make move
      
      if (!(move & MOVE_LEGAL_MASK)) {
      
        this.makeMoveBare(move);
      
        if (this.isKingAttacked(list[LKING], nextTurn)) {
          this.unmakeMoveBare(move);
          //node.cacheUnsave();
          continue;
        }
      
        this.unmakeMoveBare(move);
        this.makeMove(move);
      }
      
      else {
        this.makeMove(move);
      }
      
      //}}}
  
      count += this.perft(node.child, depth-1);
  
      this.unmakeMove(move);
      node.cacheUnsave();
    }
  
    return count;
  }
  
  //}}}
  //{{{  datagen
  
  cwtchStruct.prototype.datagen = function (file, games, softNodes, hardNodes, random, first) {
  
    const fs = require('fs');
  
    //{{{  check args
    
    try {
      fs.accessSync(file, fs.constants.F_OK);
      console.log('file exists!',file);
      process.exit();
    } catch (err) {
      ;
    }
    
    if (isNaN(games))
      games = 60000;  // ~24 hours
    
    if (isNaN(softNodes))
      softNodes = 6000;
    
    if (isNaN(hardNodes))
      hardNodes = 12000;
    
    if (isNaN(random))
      random = 10;
    
    if (isNaN(first))
      first = 16;
    
    console.log('file',file,'games',games,'softnodes',softNodes,'hardnodes',hardNodes,'randomply',random,'firstply',first);
    
    //}}}
    //{{{  randomise
    
    let now = new Date();
    let midnight = new Date(now);
    midnight.setHours(0, 0, 0, 0);
    let n = Math.floor((now - midnight) / 1000);
    for (let i=0; i < n; i++)
      Math.random();
    
    //}}}
  
    this.quiet = 1;
  
    fs.writeFileSync(file,'');
  
    let out = '';
    let score = 0;
    let move = 0;
  
    for (let g=0; g < games; g++) {
  
      //{{{  init new game
      
      const percent = g/games * 100 | 0;
      
      process.stdout.write(g + '/' + games + ' ' + percent + '%\r');
      
      this.newGame();
      
      this.uciExec('position startpos');
      
      let ply  = 0;
      let fens = [];
      let good = 0;
      
      //}}}
  
      while (true) {
  
        //{{{  wdl?
        
        const turn     = this.turn;
        const nextTurn = colourToggle(turn);
        const cx       = colourIndex(turn);
        const list     = this.cxList[cx];
        const inCheck  = this.isKingAttacked(list[LKING], nextTurn);
        
        if (fens.length > 0)
          fens[fens.length-1] = fens[fens.length-1] + ((inCheck) ? 'g ' : '- ');  // update gives check
        
        //{{{  end of game?
        
        let wdl = '';
        
        const rm = this.randomMove();  // return 0 if no moves
        
        if (rm == 0) {
        
          wdl = '0.5';
        
          if (inCheck) {
            if (turn == BLACK)
              wdl = '1.0';
            else
              wdl = '0.0';
          }
        }
        
        else if (good > 20) {
          if (score > 0)
            wdl = '1.0';
          else
            wdl = '0.0';
        }
        
        else if (this.isDraw())
        
          wdl = '0.5';
        
        else if (this.hHistoryNext - this.hHistoryLimit > 60)
        
          wdl = '0.5';
        
        //}}}
        
        if (wdl.length) {
        
          //{{{  update fens and buffer
          
          for (var i=0; i < fens.length; i++)
            fens[i] = fens[i] + wdl;
          
          for (var i=0; i < fens.length; i++)
            out += fens[i] + '\r\n';
          
           if (out.length > 1000000) {
            fs.appendFileSync(file,out);
             out = '';
          }
          
          //}}}
        
          break;
        }
        
        //}}}
        //{{{  get move
        
        const fen = this.fen(ply+1);
        
        move  = 0
        score = 0;
        
        if (ply < random) {
          move  = this.randomMove();
          score = 99999;
          if (move == 0) {
            console.log('0 move random');
            this.printBoard();
          }
        }
        else {
          this.uciExec('go nodes ' + hardNodes + ' softnodes ' + softNodes);
          move  = this.bestMove;
          score = this.bestScore;
          if (Math.abs(score) > 600)
            good++;
          else
            good = 0;
          if (move == 0) { //hack
            console.log('0 move search');
            this.printBoard();
          }
        }
        
        if (this.turn == BLACK)
          score = -score;
        
        let fenStr = '';
        fenStr += fen + ' ';
        fenStr += score.toString() + ' ';
        fenStr += formatMove(move) + ' ';
        fenStr += (moveIsNoisy(move)) ? 'n ' : '- ';
        //fenStr += (move & MOVE_PROMOTE_MASK) ? 'p ' : '- ';
        fenStr += (inCheck) ? 'c ' : '- ';
        
        if (ply >= first)
          fens.push(fenStr);
        
        //}}}
  
        this.makeMove(move);
  
        ply++;
      }
    }
  
    if (out.length) {
      fs.appendFileSync(file,out);
        out = '';
    }
  
    this.quiet = 0;
  
    console.log('written',games,'games to',file);
  }
  
  //}}}
  
  //{{{  newGame
  
  cwtchStruct.prototype.newGame = function () {
  
    this.ttInit();
  
    for (let i=0; i < MAX_PLY; i++) {
      this.nodes[i].killer = 0;
    }
  
  }
  
  //}}}
  //{{{  position
  
  cwtchStruct.prototype.position = function (sb, st, sr, sep) {
  
    const b = this.board;
  
    this.listReset();
    this.netReset();
  
    b.fill(EDGE);
  
    for (let i=0; i < 64; i++)
      b[B88[i]] = 0;
  
    //{{{  board board
    
    let sq   = 0;
    let rank = 7;
    let file = 0;
    
    for (let i=0; i < sb.length; i++) {
    
      const ch   = sb.charAt(i);
      const sq88 = (7-rank) * 8 + file;
      const sq   = B88[sq88];
    
      switch (ch) {
        //{{{  1-8
        
        case '1':
          file += 1;
          break;
        case '2':
          file += 2;
          break;
        case '3':
          file += 3;
          break;
        case '4':
          file += 4;
          break;
        case '5':
          file += 5;
          break;
        case '6':
          file += 6;
          break;
        case '7':
          file += 7;
          break;
        case '8':
          break;
        
        //}}}
        //{{{  /
        
        case '/':
          rank--;
          file = 0;
          break;
        
        //}}}
        //{{{  white
        
        case 'P':
          b[sq] = W_PAWN;
          this.netAdd(W_PAWN, sq);
          this.listExtend(W_PAWN,sq);
          file++;
          break;
        case 'N':
          b[sq] = W_KNIGHT;
          this.netAdd(W_KNIGHT, sq);
          this.listExtend(W_KNIGHT,sq);
          file++;
          break;
        case 'B':
          b[sq] = W_BISHOP;
          this.netAdd(W_BISHOP, sq);
          this.listExtend(W_BISHOP,sq);
          file++;
          break;
        case 'R':
          b[sq] = W_ROOK;
          this.netAdd(W_ROOK, sq);
          this.listExtend(W_ROOK,sq);
          file++;
          break;
        case 'Q':
          b[sq] = W_QUEEN;
          this.netAdd(W_QUEEN, sq);
          this.listExtend(W_QUEEN,sq);
          file++;
          break;
        case 'K':
          b[sq] = W_KING;
          this.netAdd(W_KING, sq);
          this.listExtend(W_KING,sq);
          file++;
          break;
        
        //}}}
        //{{{  black
        
        case 'p':
          b[sq] = B_PAWN;
          this.netAdd(B_PAWN, sq);
          this.listExtend(B_PAWN,sq);
          file++;
          break;
        case 'n':
          b[sq] = B_KNIGHT;
          this.netAdd(B_KNIGHT, sq);
          this.listExtend(B_KNIGHT,sq);
          file++;
          break;
        case 'b':
          b[sq] = B_BISHOP;
          this.netAdd(B_BISHOP, sq);
          this.listExtend(B_BISHOP,sq);
          file++;
          break;
        case 'r':
          b[sq] = B_ROOK;
          this.netAdd(B_ROOK, sq);
          this.listExtend(B_ROOK,sq);
          file++;
          break;
        case 'q':
          b[sq] = B_QUEEN;
          this.netAdd(B_QUEEN, sq);
          this.listExtend(B_QUEEN,sq);
          file++;
          break;
        case 'k':
          b[sq] = B_KING;
          this.netAdd(B_KING, sq);
          this.listExtend(B_KING,sq);
          file++;
          break;
        
        //}}}
        default:
          console.log('unknown board char','|'+ch+'|');
      }
    }
    
    //}}}
    //{{{  board turn
    
    if (st == 'w')
      this.turn = WHITE;
    
    else if (st == 'b')
      this.turn = BLACK;
    
    else
      console.log('unknown board colour', st)
    
    //}}}
    //{{{  board rights
    
    this.rights = 0;
    
    for (let i=0; i < sr.length; i++) {
    
      const ch = sr.charAt(i);
    
      if (ch == 'K') this.rights |= WHITE_RIGHTS_KING;
      if (ch == 'Q') this.rights |= WHITE_RIGHTS_QUEEN;
      if (ch == 'k') this.rights |= BLACK_RIGHTS_KING;
      if (ch == 'q') this.rights |= BLACK_RIGHTS_QUEEN;
    }
    
    //}}}
    //{{{  board ep
    
    if (sep.length == 2)
      this.ep = COORDS.indexOf(sep)
    
    else
      this.ep = 0;
    
    //}}}
  
    this.hashCalc();
    this.historyReset();
  
  }
  
  //}}}
  //{{{  playMove
  
  cwtchStruct.prototype.playMove = function (uciMove) {
  
    const node = this.nodes[0];
  
    const turn     = this.turn;
    const nextTurn = colourToggle(turn);
    const cx       = colourIndex(turn);
    const inCheck  = this.isKingAttacked(this.cxList[cx][LKING], nextTurn);
  
    node.ttMove = 0;
  
    node.initMoveGen(ALL_MOVES,inCheck);
  
    let move = 0;
  
    while (move = node.getNextMove()) {
  
      if (formatMove(move) == uciMove) {
        this.makeMove(move);
        return move;
      }
    }
  
    console.log('info cannot play uci move', uciMove);
    process.exit();
  }
  
  //}}}
  //{{{  randomMove
  
  cwtchStruct.prototype.randomMove = function () {
  
    const turn     = this.turn;
    const nextTurn = colourToggle(turn);
    const cx       = colourIndex(turn);
    const list     = this.cxList[cx];
    const inCheck  = this.isKingAttacked(list[LKING], nextTurn);
    const node     = this.nodes[0];
  
    let move  = 0;
    let moves = [];
  
    node.cacheSave();
    node.initMoveGen(ALL_MOVES, inCheck);
  
    node.ttMove = 0;
  
    while (move = node.getNextMove()) {
  
      //{{{  make move
      
      if (!(move & MOVE_LEGAL_MASK)) {
      
        this.makeMoveBare(move);
      
        if (this.isKingAttacked(list[LKING], nextTurn)) {
          this.unmakeMoveBare(move);
          //node.cacheUnsave();
          continue;
        }
      
        this.unmakeMoveBare(move);
        this.makeMove(move);
      }
      
      else {
        this.makeMove(move);
      }
      
      //}}}
  
      moves.push(move);
  
      this.unmakeMove(move);
      node.cacheUnsave();
    }
  
    if (moves.length)
      return moves[(Math.random() * moves.length)|0];
    else
      return 0;
  }
  
  //}}}
  
  //{{{  netSlowEval
  
  cwtchStruct.prototype.netSlowEval = function () {
  
    const b  = this.board;
    const cx = colourMultiplier(this.turn)
  
    let h1 = Array(net_h1_size);
    for (let j=0; j < net_h1_size; j++) {
      h1[j] = net_h1_b[j];
    }
  
    for (let sq=0; sq<64; sq++) {
  
      const fr    = B88[sq];
      const frObj = b[fr];
  
      if (!frObj)
        continue;
  
      const index = inputIndex(frObj, fr);
  
      for (let i=0; i < net_h1_size; i++) {
        h1[i] += net_h1_w[index][i];
      }
    }
  
    let e = net_o_b;
  
    for (let i=0; i < net_h1_size; i++) {
      e += net_o_w[i] * relu(h1[i]);
    }
  
    return e * cx | 0;
  }
  
  //}}}
  //{{{  netFastEval
  
  cwtchStruct.prototype.netFastEval = function () {
  
    const cx = colourMultiplier(this.turn)
  
    let e = net_o_b;
  
    for (let i=0; i < net_h1_size; i+=NET_PAR) {
      e += net_o_w[i+0] * relu(this.net_h1_a[i+0]);
      e += net_o_w[i+1] * relu(this.net_h1_a[i+1]);
      e += net_o_w[i+2] * relu(this.net_h1_a[i+2]);
      e += net_o_w[i+3] * relu(this.net_h1_a[i+3]);
      e += net_o_w[i+4] * relu(this.net_h1_a[i+4]);
      e += net_o_w[i+5] * relu(this.net_h1_a[i+5]);
      e += net_o_w[i+6] * relu(this.net_h1_a[i+6]);
      e += net_o_w[i+7] * relu(this.net_h1_a[i+7]);
    }
  
    return e * cx | 0;
  }
  
