  //{{{  listReset
  
  cwtchStruct.prototype.listReset = function () {
  
    this.listPtr.fill(0);
  
    this.wList[LCOUNT] = 1;
    this.bList[LCOUNT] = 1;
  
  }
  
  //}}}
  //{{{  listExtend
  
  cwtchStruct.prototype.listExtend = function (obj, sq) {
  
    const list = this.objList[obj];
    const num  = list[LCOUNT] + 1;
  
    if (obj == W_KING || obj == B_KING) {
      list[LKING] = sq;
      this.listPtr[sq] = 1;
    }
    else {
      list[num] = sq;
      this.listPtr[sq] = num;
      list[LCOUNT] = num;
    }
  }
  
